import React from "react";
import { Link } from "react-router-dom";
import Login from "./components/Login";
import Signup from "./components/components/Signup";

const Home = () => {
	return (
		<div>
			<div class="home">
				<Link to="/login">Log In</Link>
				<br></br>
				<Link to="/signup">Sign Up</Link>
				<br></br>
			</div>
		</div>
	);
};
export default Home;
